class Solution {
  int minimumCost(String source, String target, List<String> original, List<String> changed, List<int> cost) {
    Map<String, List<int>> transitions = {};
    for (int i = 0; i < original.length; i++) {
      String key = "${original[i]}->${changed[i]}";
      transitions.putIfAbsent(key, () => []).add(cost[i]);
    }

    transitions.forEach((key, values) {
      values.sort(); // Ensure the lowest cost is first
    });

    int totalCost = 0;
    for (int i = 0; i < source.length; i++) {
      if (source[i] == target[i]) continue;
      String key = "${source[i]}->${target[i]}";
      if (!transitions.containsKey(key) || transitions[key]!.isEmpty) {
        return -1; // Impossible to convert
      }
      totalCost += transitions[key]![0]; // Use the lowest cost
    }

    return totalCost;
  }
}
